@prefix : <http://www.semanticweb.org/ontology#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ATM a owl:Class .

:UserTransaction a owl:Class .

:CardInsertion a owl:Class ; 
               rdfs:subClassOf [ 
                  a owl:Restriction ; 
                  owl:onProperty :initiates ; 
                  owl:someValuesFrom :UserTransaction
               ] .

:initiates a owl:ObjectProperty ;
            rdfs:domain :ATM ;
            rdfs:range :UserTransaction .

:logs a owl:ObjectProperty ;
       rdfs:domain :ATM ;
       rdfs:range :UserTransaction ;
       rdfs:subPropertyOf :initiates .
